            />

            <div className="banner-text">
              <h1>Software Engineer</h1>
              <hr></hr>
              <p>HTML/CSS | Java | JavaScript | React | Vue | Swift | Python</p>
            </div>
          </Cell>
       </Grid>
       <Footer>

       </Footer>

      </div>
    )
  }
}

export default Landing;
